define({
    inputs: {
        collection: 'collection',
        checkForFocus: 'boolean'
    },
    outputs: {
        id: 'string',
        changed: 'boolean'
    },
    setup: function(inputs, outputs) {
        var self = this;
        this.hasFocusedFirstItem = false;
        this.focusFirstItemInCollection = function(model)
        {
            var now = new Date(Date.now());
            var eventDateTime = model.get('DateTime');
            console.log('now', now);
            if(eventDateTime > now) {
                console.log('Start focus candidate was good. Focusing', eventDateTime);
                outputs.id = model.getId();
                self.flagOutputDirty('id');
                self.sendSignalOnOutput('changed');
                inputs.collection.off('add', self.focusFirstItemInCollection);  
                return true;
            } else {
                console.log('Start focus candidate event occured in the past. Ignoring', eventDateTime);
            }
            return false;
        }
    },
    run: function(inputs, outputs) {
        var self = this;
        if(inputs.collection !== undefined && inputs.checkForFocus === true)
        {
            if(inputs.collection.size() > 0) {
                for(var i = 0; i < inputs.collection.size(); ++i) {
                    var wasFocused = self.focusFirstItemInCollection(inputs.collection.get(i));
                    if(wasFocused) {
                        return;
                    }
                }
            } else {
                inputs.collection.on('add', self.focusFirstItemInCollection);
            }
        }
    }
});

