define({
    inputs: {
        panePositionX: 'number',
        paneWidth: 'number',
        screenWidth: 'number'
    },
    outputs: {
        outside: 'boolean',
        partlyInside: 'boolean',
        fullyInside: 'boolean',
        insideAmount: 'number'
    },
    setup: function(inputs, outputs) {
        this.state = 'fullyInside'; 
    },
    run: function(inputs, outputs) {
        var leftEdgeScreenPosition = inputs.panePositionX;
        var rightEdgeScreenPosition = leftEdgeScreenPosition + inputs.paneWidth;
        var newState = null;
        if(leftEdgeScreenPosition >= inputs.screenWidth || rightEdgeScreenPosition <= 0)
        {
            newState = 'outside';
        }
        else if(leftEdgeScreenPosition !== 0)
        {
            newState = 'partlyInside';
        }
        else
        {
            newState = 'fullyInside';
        }

        if(this.state !== newState)
        {
            this.sendSignalOnOutput(newState);
        }

        var distance = Math.abs(leftEdgeScreenPosition / inputs.paneWidth);
        outputs.insideAmount = Math.min(1.0,Math.max(0,1.0 - distance));
        this.state = newState;
    }
});


