define({
    inputs: {
        getPosition: 'boolean'
    },
    outputs: {
        longitude: 'number',
        latitude: 'number',
        locationUpdated: 'boolean'
    },
    run: function(inputs, outputs) {
        var self = this;

        function onPositionSuccess(position) {
            outputs.latitude = position.coords.latitude;
            outputs.longitude = position.coords.longitude;
            self.flagOutputDirty('latitude');
            self.flagOutputDirty('longitude');
            self.sendSignalOnOutput('locationUpdated');
            console.log('Gelocation position updated', position.coords);
        }

        function onPositionError(error){
            console.log('geolocation error (' + error.code + '): ' + error.message);
            if(Application.instance.context.runningInEditor) {
                var MalmoCoords = {
                    latitude: 55.5933202,
                    longitude: 13.008474
                };
                console.log('Running in edior, faking a location');
                outputs.latitude = MalmoCoords.latitude;
                outputs.longitude = MalmoCoords.longitude;
                self.flagOutputDirty('latitude');
                self.flagOutputDirty('longitude');
                self.sendSignalOnOutput('locationUpdated');
            }
        }

        if(inputs.getPosition === true)
        {
            var Options = {
                timeout: 5000,
            }
            console.log('querying position. Navigator:', navigator);
            navigator.geolocation.getCurrentPosition(onPositionSuccess, onPositionError, Options);
        }
    }
});

