define({
    inputs: {
        focusedItemId: 'string',
    },
    outputs: {
        setIndex: 'number',
        score: 'number'
    },
    setup: function(inputs, outputs) {
    },
    run: function(inputs, outputs) {

        if(inputs.focusedItemId !== undefined)
        {
            var focusedItemModel = Noodl.Model.get(inputs.focusedItemId);
            var type = focusedItemModel.get('Type');
            if(type !== "Sunrise" && type !== "Sunset")
            {
                return;
            }
            var eventParameters = focusedItemModel.get('Event Parameters');

            var colorSetIndex = 0;

            if(type === "Sunrise" || type === "Sunset"){
                if(eventParameters.Score <= 0.25){
                    colorSetIndex = 0;
                } else if (eventParameters.Score <= 0.5){
                    colorSetIndex = 1;
                } else if (eventParameters.Score <= 0.75){
                    colorSetIndex = 2;
                } else {
                    colorSetIndex = 3;
                }
            }

            outputs.score = eventParameters.Score;
            outputs.setIndex = colorSetIndex;
        }
    }
});

define({
    inputs: {
        value: 'color',
        duration: 'number'
    },
    outputs: {
        result: 'color'
    },
    setup: function(inputs, outputs) {

        this.hexToArray = function(hex) {
            var noHash = hex.charAt(0) === '#' ? hex.substring(1,7) : hex;

            return [
                parseInt(noHash.substring(0,2), 16) / 255.0,
                parseInt(noHash.substring(2,4), 16) / 255.0,
                parseInt(noHash.substring(4,6), 16) / 255.0,
                ];
        }

        var self = this;
        self.targetColorString = undefined;
        self.startColorString = undefined;
        self.targetColor = undefined;
        self.startColor = undefined;

        this.animation = Application.instance.context.timerScheduler.createTimer({
            duration: inputs.duration ? inputs.duration : 300,
            startValue: 0,
            endValue: 1,
            ease: Noodl.AnimationCurve.easeOut,
            onStart: function() {
                outputs.result = self.startColorString;
                self.flagOutputDirty('result');
            },
            onRunning: function(t) {
                var interpolatedColor = [0,0,0];
                var hex = '#'
                for(var i = 0; i < 3; ++i) {
                    interpolatedColor[i] = (self.startColor[i] * (1-t) + self.targetColor[i] * t)*255.0;
                    hex += Math.round(interpolatedColor[i]).toString(16);
                }
                outputs.result = hex;
                self.flagOutputDirty('result');
            },
            onFinish: function() {
                outputs.result = self.targetColorString;
                self.flagOutputDirty('result');
            }
        });
    },
    run: function(inputs, outputs) {
        var self = this;
        self.animation.duration = inputs.duration ? inputs.duration : 300;
        if(inputs.value !== self.targetColorString)
        {
            if(self.targetColorString === undefined) {
                self.startColorString = inputs.value;
            } else {
                self.startColorString = self.targetColorString;
            }
            self.targetColorString = inputs.value;

            self.startColor = self.hexToArray(self.startColorString);
            self.targetColor = self.hexToArray(self.targetColorString);

            self.animation.stop();
            self.animation.start();
        }
    }
});

define({
    inputs: {
        numEventCollections: 'number',
        focusedEventId: 'string'
    },
    outputs: {
        scrollFactor: 'number',
        stepSize: 'number'
    },
    setup: function(inputs, outputs) {
        var self = this;
        this.updatePosition = function()
        {
            var numEventsTotal = 0;
            var eventIndex = 0;
            for(var i = 0; i < inputs.numEventCollections;++i)
            {
                var collection = Noodl.Collection.get('Events' + i);
                for(var j = 0; j < collection.size(); ++j)
                {
                    if(collection.get(j).getId() === inputs.focusedEventId )
                    {
                        eventIndex = numEventsTotal;
                    }
                    ++numEventsTotal;
                }
            }    

            if(numEventsTotal > 0) {
                outputs.scrollFactor = eventIndex / numEventsTotal;
                outputs.stepSize = 1.0 / numEventsTotal;
            } else {
                outputs.scrollFactor = 0;
                outputs.stepSize = 0;
            }
            self.flagOutputDirty('stepSize');
            self.flagOutputDirty('scrollFactor');
        }

        for(var i = 0; i < inputs.numEventCollections;++i)
        {
            var collection = Noodl.Collection.get('Events' + i);
            collection.on('change', this.updatePosition);
        }
    },
    run: function(inputs, outputs) {
        this.updatePosition();
    }
});

