define({
    outputs: {
        loaded: 'boolean',
        error: 'boolean'
    },
    setup: function(inputs, outputs) {
        var self = this;
        var scriptTag = document.createElement('script');

        var url = 'cordova.js'
        if(Application.instance.context.runningInEditor && url[0] !== '/') {
            url = '/' + url;
        }
        scriptTag.src = url;

        document.body.appendChild(scriptTag);
        scriptTag.addEventListener('error', function(){
            self.sendSignalOnOutput('error');
        });
        scriptTag.addEventListener('load', function(){
            console.log('Cordova loaded OK');
        });
        document.addEventListener("deviceready",  function(){
            console.log('deviceready');
            self.sendSignalOnOutput('loaded');
        });
    }
});

